            result.d /= 10;
            result.e++;
        } else {
            result.n -= result.d * 10;
            result.d *= 10;
            result.e++;
        }
    }
    return result;
}

struct frac mul_fractions(struct frac a, struct frac b) {
    struct frac result;
    result.n = a.n * b.n;
    result.d = a.d * b.d;
    result.e = a.e + b.e;
    while (result.e >= 0) {
        if (result.d > 99999) {
            result.n *= 100000;
            result.d /= 100000;
            result.e--;
        } else break;
    }
    while (result.e < 0) {
        if (result.n >= result.d) {
            result.n -= result.d * 10;
            result.d *= 10;
            result.e++;
        } else break;
    }
    return result;
}

long long gcd(long long a, long long b){
    if (b == 0) return a;
    return gcd(b, a % b);
}

